Фотография: Пресс-служба губернатора и правительства Пермского края
Губернатор Пермского Края Александр Мишарин встретился с журналистами в пресс-центре «Пермь-36». В беседе с корреспондентом «АиФ-Прикамье» он рассказал о своем видении развития Пермского региона и его социальной роли.
- Александр Владимирович, вы недавно посетили Пермь, побывали в Музее истории
